- Change: Provision to override default connector worker queue names with environment variable.
- Requirement:  For each connector on Borneo, the installation will have its own queue initialization. Hence each airbyte connector needs to have these queues defined uniquely and should have the provision for them to be defined dynamically so that the respective connector workflows can be called from borneo-worker.

Variables can be defined as follows in the `.env` file

```
CHECK_CONNECTION_TASK_QUEUE=connector-1-check
GET_SPEC_TASK_QUEUE=connector-1-spec
DATA_SYNC_TASK_QUEUES=connector-1-sync
DISCOVER_SCHEMA_TASK_QUEUE=connector-1-discover
